#include <stdlib.h>
#include <stdio.h>
/* Screen size. */
#define RESOLUTION_X 320
#define RESOLUTION_Y 240

/* Constants for animation */
#define CARD_WIDTH 27
#define CARD_HEIGHT 40
#define CARD_SIZE 2160
#define COLOUR_SIZE 25920

struct Card {
    int colour;
    int number;
    int ifSelected;
};

struct Card user_deck[11];
struct Card ai_deck[11];
struct Card curr_card;
struct Card random_card;

const unsigned char card_back[2160];
const unsigned char card_lib[110160];

void clear_screen(void);
void plot_pixel(int x, int y, short int line_color);
void draw_card(int orgX, int orgY, int color, int number);
void draw_back(int orgX, int orgY);
void display_curr_card();
void display_ai_deck();
void display_user_deck();
void display_deck();

volatile int pixel_buffer_start; // global variable

void card_generator(){
    random_card.colour = rand()%5;
    if (random_card.colour == 4){
        random_card.number = rand()%2;
    }
    else{
        random_card.number = rand()%12; 
    }

  random_card.ifSelected = 0;
}

int main(void)
{
  volatile int * pixel_ctrl_ptr = (int *)0xFF203020;
  /* Read location of the pixel buffer from the pixel buffer controller */
  pixel_buffer_start = *pixel_ctrl_ptr;

  clear_screen();

  ai_deck[11].colour = 4;
  ai_deck[11].number = 2;
  ai_deck[10].colour = 4;
    ai_deck[10].number = 2;
    ai_deck[9].colour = 4;
    ai_deck[9].number = 2;
    ai_deck[8].colour = 4;
    ai_deck[8].number = 2;
    ai_deck[7].colour = 4;
    ai_deck[7].number = 2;
    ai_deck[6].colour = 4;
    ai_deck[6].number = 2;
    ai_deck[5].colour = 4;
    ai_deck[5].number = 2;
    ai_deck[4].colour = 2;
    ai_deck[4].number = 4;
    ai_deck[3].colour = 2;
    ai_deck[3].number = 3;
    ai_deck[2].colour = 2;
    ai_deck[2].number = 2;
    ai_deck[1].colour = 2;
    ai_deck[1].number = 1;
    ai_deck[0].colour = 2;
    ai_deck[0].number = 5;

 for(int i = 0; i < 10;i++){
    card_generator();
    user_deck[i] = random_card;

    if (i > 4){
      user_deck[i].colour = 4;
      user_deck[i].number = 2;
    }
            
  }

  curr_card.colour = 2;
  curr_card.number = 3;
  curr_card.ifSelected = 0;          

	display_curr_card();
  display_deck();
	display_ai_deck();
	display_user_deck();

   
}

void display_curr_card(){
	draw_card(147, 100, curr_card.colour, curr_card.number);
  printf(" %d  %d", curr_card.colour, curr_card.number);
  //draw_card(147, 100, 2, 3);
}

void display_ai_deck(){
	int i;
	for(i = 0; i < 10; i++){
    if(!(ai_deck[i].colour == 4 && ai_deck[i].number == 2)){
      draw_back(319 - (CARD_WIDTH + 5)*(i+1), 10);
    }
	}
	
}

void display_user_deck(){
	int i;
	for(i = 0; i < 10; i++){
		draw_card(319 - (CARD_WIDTH + 10)*(i+1), 219 - CARD_HEIGHT - 10 - user_deck[i].ifSelected * 10, user_deck[i].colour, user_deck[i].number);
	}

}

void display_deck(){
	draw_back(80, 100);
	draw_back(70, 100);
}

void draw_back(int orgX, int orgY)
{
	int i, j;
	int data ;	
	
	for (i = 0; i < CARD_HEIGHT ; i++)
	{		
		for(j=0 ; j < CARD_WIDTH; j++)	
		{ 	
			data = card_back[(i*CARD_WIDTH+j)*2+1] ;
			data = data << 8;
			data += card_back[(i*CARD_WIDTH+j)*2];	
			plot_pixel(orgX+j, orgY+i, data);
			//printf(" x, y  = %d, %d,   data = %x, \n ", j, i,data );
		}		
	}
}


void draw_card(int orgX, int orgY, int color, int number)
{
	// 
	int i, j;
	int Pos, data ;
	
	Pos = color * COLOUR_SIZE + number * CARD_SIZE ;
	for (i = 0; i < CARD_HEIGHT ; i++)
	{		
		for(j=0 ; j < CARD_WIDTH; j++)	
		{ 	
			data = card_lib[Pos+(i*CARD_WIDTH+j)*2+1] ;
			data = data << 8;
			data += card_lib[Pos+(i*CARD_WIDTH+j)*2];	
			plot_pixel(orgX+j, orgY+i, data);
			//printf(" x, y  = %d, %d,   data = %x, \n ", j, i,data );
		}		
	}
}

void plot_pixel(int x, int y, short int line_color)
{
    *(short int *)(pixel_buffer_start + (y << 10) + (x << 1)) = line_color;
}

void clear_screen(void)
{
	int x, y;
	for (x=0; x < RESOLUTION_X; x++)
	{
		for( y=0; y< RESOLUTION_Y; y++)
			plot_pixel( x,  y, 0x0000); //0x001F);// test blue 0x0000);
	}
}

